  const numbers = [1, 2, 3, 4, 5];

  function ListItem(props) {
    return <li>{props.value}</li>;
  }

  function ListText(props) {
    const items = props.items;
    return (
      <ul>
        {items.map((item, key) =>
          <ListItem key={key.toString()}
